function Home() {

    $(function() {
        $('.scroll-down').click (function() {
          $('html, body').animate({scrollTop: $('section.ok').offset().top }, 'slow');
          return false;
        });
      });

    return (
        <div id="splash" className="container-fluid text-center">
            <div id="pleaseWork"></div>
            <div id="splash_title" className="d-flex justify-content-center">Journey Through Code</div>
            <div id="splash_text" className="text-center">Blog by Katy Simpson</div> 
            <section>
                <p>SCROLL DOWN CSS</p>
                <a href="#" class="scroll-down" address="true"></a>
                </section>
                <section class="ok">
<p>OK SCROLL !</p>
</section>
        </div>
    );
}

export default Home;
